    cat_index = -1
    mouse_index = -1
    dog_index = -1
    for i in range(len(x)):
        if x[i] == 'C':
            cat_index = i
        elif x[i] == 'D':
            dog_index = i
        elif x[i] == 'm':
            mouse_index = i
    if cat_index == -1 or mouse_index == -1 or dog_index == -1:
        return 'boring without all three'
    cat_distance = abs(cat_index - mouse_index)
    if cat_distance <= j:
        return 'Caught!'
    if dog_index <= max(cat_index, mouse_index):
        return 'Protected!'
    return 'Escaped!'
